const Weather = () => {
    return (
        <div className="container">
            <div className="cards">
                <h1>Londres</h1>
                <h5 className="py-4">
                    <i className="wi wi-day-summy" />
                </h5>
            </div>
        </div>
    );
}

export default Weather;
